import ArticleCard from 'src/components/molecules/ArticleCard'

const Home: React.FC = () => {
  const articleCards = [1, 2, 3, 4].map((x) => (
    <Box>
      <ArticleCard />
    </Box>
  ))
  return <>{articleCards}</>
}

export default Home
